       <div className="form-conatiner">
        .form-image
       <form action="/">
        <div className="username">
          <input type="text" placeholder='Name'/>
        </div>
        <div className="Email">
          <input type="text" placeholder='Email'/>
        </div>
        <div className="username">
          <input type="text"placeholder='Message' />
        </div>
       </form>
       </div>
      </div>
    </section>
    </>
  );
}

export default Login;

